import React from 'react';
import { useAuth } from '../../context/AuthContext';

const MemberDashboard = () => {
  const { currentUser } = useAuth();
  
  return (
    <div style={{ padding: '20px' }}>
      <h1>Member Dashboard</h1>
      <p>Welcome, {currentUser?.name || 'Member'}!</p>
      
      <div style={{ 
        display: 'grid', 
        gridTemplateColumns: 'repeat(auto-fit, minmax(250px, 1fr))', 
        gap: '20px',
        marginTop: '30px'
      }}>
        <div style={{ 
          background: 'white', 
          padding: '20px', 
          borderRadius: '8px',
          boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
        }}>
          <h3>Pending Dues</h3>
          <p style={{ fontSize: '24px', fontWeight: 'bold' }}>â‚¹5,000</p>
        </div>
        
        <div style={{ 
          background: 'white', 
          padding: '20px', 
          borderRadius: '8px',
          boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
        }}>
          <h3>Last Payment</h3>
          <p style={{ fontSize: '24px', fontWeight: 'bold' }}>2025-09-15</p>
        </div>
        
        <div style={{ 
          background: 'white', 
          padding: '20px', 
          borderRadius: '8px',
          boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
        }}>
          <h3>Notifications</h3>
          <p style={{ fontSize: '24px', fontWeight: 'bold' }}>3</p>
        </div>
        
        <div style={{ 
          background: 'white', 
          padding: '20px', 
          borderRadius: '8px',
          boxShadow: '0 2px 5px rgba(0,0,0,0.1)'
        }}>
          <h3>My Reports</h3>
          <p style={{ fontSize: '24px', fontWeight: 'bold' }}>3</p>
        </div>
      </div>
    </div>
  );
};

export default MemberDashboard;
